        # 20260119 客户反馈（第3点，口述）：正视图预制/后浇“两个矩形框”边不重合/有缝隙排查
        # 说明：本脚本采用“预制段 Solid + 后浇段 Solid”以区分材料；界面处应当共面（z=hp）且无几何间隙。
        _hp_eff = float(locals().get("__HP_EFFECTIVE__", 1025.0) or 1025.0)
        _L = float(locals().get("__L__", 0.0) or 0.0)
        _pre_yz = locals().get("precast_yz", None)
        _cast_yz = locals().get("cast_yz", None)
        def _yz_minmax(_yz, zsel=None, tol=1e-6):
            if not isinstance(_yz, list):
                return None, None, None, None
            ys = [float(p[0]) for p in _yz if isinstance(p, (list, tuple)) and len(p) >= 2]
            zs = [float(p[1]) for p in _yz if isinstance(p, (list, tuple)) and len(p) >= 2]
            y0 = min(ys) if ys else None
            y1 = max(ys) if ys else None
            z0 = min(zs) if zs else None
            z1 = max(zs) if zs else None
            if zsel is None:
                return y0, y1, z0, z1
            ys2 = [float(p[0]) for p in _yz if isinstance(p, (list, tuple)) and len(p) >= 2 and abs(float(p[1]) - float(zsel)) <= tol]
            return (min(ys2) if ys2 else None), (max(ys2) if ys2 else None), z0, z1
        _pre_y0, _pre_y1, _pre_z0, _pre_z1 = _yz_minmax(_pre_yz)
        _cast_y0, _cast_y1, _cast_z0, _cast_z1 = _yz_minmax(_cast_yz)
        _gap_z = None
        if _pre_z1 is not None and _cast_z0 is not None:
            _gap_z = float(_cast_z0) - float(_pre_z1)
        _ok_z = (_gap_z is not None) and (abs(float(_gap_z)) <= 1e-6) and (abs(float(_pre_z1) - _hp_eff) <= 1e-6) and (abs(float(_cast_z0) - _hp_eff) <= 1e-6)
        _check("geom.interface.z_match", expected=0.0, actual=_gap_z, ok=_ok_z, fatal=True, hp=_hp_eff, pre_zmax=_pre_z1, cast_zmin=_cast_z0)
        _pre_yhp0, _pre_yhp1, _, _ = _yz_minmax(_pre_yz, zsel=_hp_eff)
        _cast_yhp0, _cast_yhp1, _, _ = _yz_minmax(_cast_yz, zsel=_hp_eff)
        _ok_y = (_pre_yhp0 is not None and _pre_yhp1 is not None and _cast_yhp0 is not None and _cast_yhp1 is not None and abs(float(_pre_yhp0) - float(_cast_yhp0)) <= 1e-6 and abs(float(_pre_yhp1) - float(_cast_yhp1)) <= 1e-6)
        _check("geom.interface.y_span_match", expected=True, actual=_ok_y, ok=_ok_y, fatal=True, hp=_hp_eff, pre=(_pre_yhp0, _pre_yhp1), cast=(_cast_yhp0, _cast_yhp1))
