        # 钢筋线段“重复建模”排查：同一对节点的线段不应被创建多次（会导致观感双层/叠线、节点不干净）
        _ecnt = {}
        for (a, b) in __REBAR_EDGES__:
            if a is None or b is None or a == b:
                continue
            e = (a, b) if a < b else (b, a)
            _ecnt[e] = _ecnt.get(e, 0) + 1
        _dups = [(e, c, __NODE_COORDS__.get(e[0]), __NODE_COORDS__.get(e[1])) for (e, c) in _ecnt.items() if c > 1]
