        _hp_rule = locals().get("__HP_RULE__", None)
        _hp_raw = locals().get("__HP_RAW__", None)
        _hp_eff = locals().get("__HP_EFFECTIVE__", None)
        _hp_exp = locals().get("__HP_EXPECTED__", None)
        _check("geom.hp.rule", expected="cast_cap_auto", actual=_hp_rule, ok=(_hp_rule == "cast_cap_auto"), fatal=True)
        if _hp_exp is not None and _hp_eff is not None:
            _check("geom.hp.value", expected=_hp_exp, actual=_hp_eff, ok=(abs(float(_hp_eff)-float(_hp_exp)) <= 1e-3), fatal=True, hp_raw=_hp_raw)
        _holes_expected = 2
        # 多洞口：不要依赖 nhole0/whole0 是否存在（可能存在多洞口/分段建模/跳号），以“inners列表是否有内容”为准
        _has_hole_pre = isinstance(locals().get("hole_pre_inners", None), list) and (len(locals().get("hole_pre_inners", [])) > 0)
        _has_hole_cast = isinstance(locals().get("hole_cast_inners", None), list) and (len(locals().get("hole_cast_inners", [])) > 0)
