            _cross = any((rz0 is not None) and (rz1 is not None) and (float(rz0) < float(_hp) - _tol) and (float(rz1) > float(_hp) + _tol) for (rz0, rz1) in _raw_pairs)
            # 洞口设计约束：洞口应完全位于预制段腹板内，不跨越叠合面（避免洞口处出现“界面薄片/共面面”影响网格）
            _check("hole.design.within_precast_only", expected=True, actual=(not _need_cast), ok=(not _need_cast), fatal=True, hp=_hp, raw_pairs=_raw_pairs)
            # 洞口设计约束：避开下翼缘顶/梁底与叠合面（默认各 50mm）
            _avoid_hp = 50.0
            _avoid_bot = 50.0
            _tfL = float(locals().get("__TF_LOWER__", 0.0) or 0.0)
